import React from "react";
import { useParams } from "react-router-dom";
import { DestList } from "../helpers/DestList";
import Skardu from "./Skardu";
import Swat from "./Swat";
import Gilgit from "./Gilgit";

function Destination(props) {
  const { name } = useParams(); // get the name parameter from the route
  const destination = DestList.find((destItem) => destItem.name === name); // find the destination object in the DestList
  console.log(name);

  switch (name) {
    case "Swat":
      return <Swat />;
    case "Skardu":
      return <Skardu />;
    case "Gilgit":
      return <Gilgit />;
    default:
      return <div>Destination not found</div>;
  }
}

export default Destination;
